import { fetchData } from 'Helper/utils';
import VendingMachine from 'Pages/VendingMachine';
import { useEffect, useState } from 'react';

const useFetch = (URL) => {
  const [url, setUrl] = useState('');
  const [data, setData] = useState();

  useEffect(() => {
    setUrl(URL);
  }, []);
  useEffect(() => {
    const getData = async () => {
      const data = await fetchData(url);
      console.log(data);
      setData(data);
    };
    getData();
    return [data, setData];
  }, [setUrl]);
  return [data, setData];
};

const WALLET_API = `http://localhost:3001/money/0`;
function App() {
  const [walletMoney, setWalletMoney] = useFetch(WALLET_API);
  console.log(walletMoney);

  return <VendingMachine />;
}

export default App;
